 Fushigi no Umi no Nadia
(الماسة الزرقاء)
عن وجود إعلان خاص للعمل في الأسبوع القادم.
. 
أشار الحساب في نفس التغريدة إلى أن العمل في تاريخ 14 أبريل الماضي قد أكمل 30 عامًا على بدء عرضه.
. 
القصة عن ناديا شابة من أصول مجهولة وجين مخترع فرنسي شاب يعيشان في العام 1889 و الذي يمثل ذروة الاكتشافات التقنية، ويواجهان خصماً يدعى غارغولين مهووس بإعادة إحياء إمبراطورية أطلانطس الغارقة وفق مخطط شرير يهدف من وراءه للهيمنة على العالم. و بمساعدة جين والنقيب نيمو قائد الغواصة “ناوتيليوس” تكافح ناديا بكل قواها لحماية العالم من شرور غارغولين وإمبراطوريته الجديدة.
. 
بدأ عرض الأنمي في 13 أبريل 1990 وانتهى في 12 أبريل 1991 واستمر لمدة 39 حلقة.
.
.
